/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';
import "./Navbar.css";
import {  Link } from "react-router-dom";

const navbar= () => {
  return (
    <header>
      <div class="left">
        <a href="#">Navbar</a>
      </div>

      <div class="mid">
		    <ul class="navbar">
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/tool">Tool</Link>
          </li>
          <li>
            <Link to="/faqs">FAQs</Link>
          </li>
          <li>
            <Link to="/contact">Contact</Link>
          </li>
        </ul>
      </div>

      <div class="right">
        <a href="#">Welcome</a>
      </div>
    </header>
  );
}
export default navbar;
